Aplikacija Moj Petrol vam omogoča preprosto sporočanje stanja, pregled porabe in naročanje energentov ter spremljanje kartičnega in finančnega poslovanja. Člani Petrol kluba lahko na Petrolovih karticah pregledujete porabo in stanje točk, aplikacija pa omogoča naročanje elektrike, zemeljskega plina in utekočinjenega naftnega plina. Aplikacija uporabnikom nudi tudi odgovore na pogosto zastavljena vprašanja, v aplikaciji pa lahko Petrolu zastavite vprašanje ali najdete kontaktne podatke in obratovalni čas klicnega centra.

Z Moj Petrol aplikacijo lahko:
- uporabniki Petrol energentov Petrol elektrika in zemeljski plin sporočate stanje števca;
- analizirate porabo elektrike in zemeljskega plina skozi mesece in tako pravočasno odkrijete potratneže v svojem gospodinjstvu;
- naročate utekočinjen naftni plin (UNP);
- pregledujete porabo na Petrol kartici s podrobnostmi transakcij in prejetih računov. Račune lahko tudi preprosto prenesete ali pošljete dalje;
- pregledujte ugodnosti na Petrol klub kartici in stanje Zlatih točk;
- izvedete identifikacijo na prodajnih mestih Petrol s pomočjo shranjene črtne kode kartice zvestobe;
- omogočite oziroma spreminjajte načine obveščanja o Petrol akcijah in ugodnostih;
- pregledujete in urejate podatke svojega Moj Petrol računa;
- pošiljate vprašanja Petrolu oziroma stopite v stik s klicnim centrom

Če še nimate Moj Petrol računa, si ga lahko v nekaj preprostih korakih ustvarite v aplikaciji s pomočjo Petrol klub kartice zvestobe ali Petrol klub plačilne kartice zvestobe oz. slikate in vnesete podatke iz katerega koli vašega Petrol računa.

YCLIENTS is an online booking service and automation platform for the service industry. The platform allows you to get booking online right from your website, social networks, maps, and other platforms. Service helps to manage your team and their schedules, send notifications and appointment reminders to your customers, carry out the inventory management and accounting. YCLIENTS is used by more than 21,000 companies and more than 10 million visitors around the world.

The YCLIENTS app makes your work easier, saves time, and allows you to control your business efficiently.

SCHEDULE
— Manage your schedule on the go: create, edit, or cancel appointments;
— View daily appointments list for branch or by an individual employee;
— Control access for each employee to view only their bookings;
— Receive instant notifications about new appointments.

CLIENT DATABASE
— View each customer’s visit history;
— Make phone calls right from the client cards;
— Send your customers appointment reminders or special offers via push, SMS and email notifications directly from the app;
— Congratulate customers on their birthday with an automated SMS and push notifications.

STATISTICS AND ANALYTICS
— Analyze your business performance for any day or selected period: revenue, employee efficiency and more;
— Quickly switch between branches to track the dynamics of business development.

PAYMENTS AND LOYALTY PROGRAMS
— Choose one or more customer loyalty cards to pay for the visit;
— Monitor your payment status. If the visit is not paid in full, you will immediately see the debt balance.

FINANCIAL AND INVENTORY MANAGEMENT
— Generate detailed reports by branch or individual employee;
— Manage consumables on the visit, If necessary, change the composition and number for each service.

The mobile app is also available for the iPad and works for companies with no desktop. Registration on www.yclients.com is required.

Z mobilno aplikacijo ePokojnina si lahko izračunate informativno višino svoje javne pokojnine in koliko dodatne pokojnine lahko še privarčujete. Prav tako si lahko izračunate za koliko si boste znižali dohodnino z vplačilom premije individualnega dodatnega pokojninskega zavarovanja.

Aplikacija omogoča:

- Informativni izračun javne pokojnine;
- Informativni izračun dodatne pokojnine, ki jo lahko privarčujemo z dodatnim varčevanjem;
- Za individualno dodatno pokojninsko zavarovanje aplikacija prikazuje informativni znesek znižanja dohodnine oz. višino davčne olajšave dodatnega pokojninskega zavarovanja;
- Možnost naročila informativne ponudbe dodatnega pokojninskega zavarovanja.
